function LogoutButton(props) {
  const { isAuthenticated, logout } = useAuth0();

  return isAuthenticated(
    <Button
      variant="outline-primary"
      onClick={() => {
        logout({
          returnTo: window.location.origin,
        });
      }}
      {...props}
    >
      ログアウト
    </Button>
  );
}

export default LogoutButton;
